int main(){
    std::vector<long long> a(3);
  std::vector<long long> b(3);
  for(int i = 0 ; i < 3 ; i++){
    scanf("%lld",&a[i]);
    scanf("%lld",&b[i]);
  }
    solve(std::move(a), std::move(b));
    return 0;
}
